  render() {
    return (
      <div>

        <form>
          <label>
            Strenght
            <input type="checkbox" value="Strenght" />
          </label>
          <label>
            Fitness
            <input type="checkbox" value="Fitness" />
          </label>
          <label>
            Flexability
            <input type="checkbox" value="Flexability" />
          </label>
        </form>
      </div>
    )
  }

}

export default ExerciseForm
